import React, { useState, useEffect } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.css';

const TeamLeads = () => {
  const [teamLeads, setTeamLeads] = useState([]);
  const [selectedLead, setSelectedLead] = useState('');
  const [newLead, setNewLead] = useState({ name: '', pak: '' });

  useEffect(() => {
    fetchTeamLeads();
  }, []);

  const fetchTeamLeads = async () => {
    try {
      const response = await axios.get('/api/teamleads');
      setTeamLeads(response.data);
    } catch (error) {
      console.error(error);
    }
  };

  const handleInputChange = (e) => {
    setNewLead({ ...newLead, [e.target.name]: e.target.value });
    setNewLead({ ...newLead, [e.target.pak]: e.target.value });
  };

  const handleSelectChange = (e) => {
    setSelectedLead(e.target.value);
  };

  const createLead = async () => {
    try {
      await axios.post('http://localhost:5000/api/teamleads', newLead);
      fetchTeamLeads();
      setNewLead({ name: '', pak: '' });
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div className="container">
      <h1>Team Leads</h1>
      <div className="mb-3">
        <label htmlFor="leadSelect" className="form-label">Select Team Lead:</label>
        <select className="form-select" id="leadSelect" value={selectedLead} onChange={handleSelectChange}>
          <option value="">-- Select Team Lead --</option>
          {teamLeads.map((lead) => (
            <option key={lead.id} value={lead.id}>{lead.name}</option>
          ))}
        </select>
      </div>
      <div className="mb-3">
        <label htmlFor="nameInput" className="form-label">Name:</label>
        <input type="text" className="form-control" id="nameInput" name="name" value={newLead.name} onChange={handleInputChange} />
      </div>
      <div className="mb-3">
        <label htmlFor="pakInput" className="form-label">pak:</label>
        <input type="pak" className="form-control" id="pakInput" name="pak" value={newLead.pak} onChange={handleInputChange} />
      </div>
      <button className="btn btn-primary" onClick={createLead}>Add Lead</button>
    </div>
  );
};

export default TeamLeads;
